import React, { useState } from 'react'

import './Register.css'

export default function FormResep() {

    const[formData, setFormData] = useState( 
        { 
            id: "", 
            judul : "",  
            deskripsi : "", 
            image : "" 
        } 
    ) 
 
    const handleChange = (event) => {  
    const { name, value } = event.target;  
    setFormData((prevState) => ({  
        ...prevState,  
        [name]: value,  
    }));  
  };  
  
    const handleSubmit = async (event) => {  
    event.preventDefault();  
  
    // Kirim nilai form ke komponen  
    console.log(formData);  
    try {  
        const response = await fetch('http://localhost:3001/formulirresep', {  
            method: 'POST',  
            headers: {  
                'Content-Type': 'application/json',  
            },  
            body: JSON.stringify(formData),  
        });  
        const jsonData = await response.json();  
        console.log(jsonData);
        } catch (error) {  
            console.log('Error sending request:', error);  
        }  
    };

    return (
    <div className='akun'>
      <div className='akun-user'>

        <h1 className='signup'>
            Formulir Resep
        </h1>

    <br/>
        <form className='isi' onSubmitCapture={handleSubmit} key={formData.id}>
            <div className="form-group">
                <label 
                for="exampleInputJudulResep1">
                Judul Resep
                </label>
                <input type="judul resep" 
                className="form-control ctrl" 
                id="exampleInputJudulResep1" 
                placeholder="Enter judul resep" 
                name='judul resep'
                value={formData.judul}
                onChange={handleChange}
                />
            </div>
    
    <br/>
            <div className="form-group">
                <label 
                for="exampleInpuDeskripsi1">
                    Deskripsi Resep
                </label>
                <input 
                type="deskripsi" 
                className="form-control ctrl" 
                id="exampleInputDeskripsi1" 
                placeholder="Enter deskripsi" 
                name='deskripsi'
                value={formData.deskripsi}
                onChange={handleChange}
                />
            </div>
        
    <br/>    
          <div className="form-group">
          <label htmlFor="image" className="form-label">
                Image:
            </label>
            <input
            className="form-control"
            type="file"
            id="image"
            accept="image/*"
            onChange={handleImageChange}
            required
            />
            </div>

        <br/>
            <button type="submit" 
            className="btn btn-primary sbmt">
                Submit
            </button>

        </form>
        </div>
    </div>
  )
}
